import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { FaCheck, FaTimes, FaFilePdf } from 'react-icons/fa';
import Swal from 'sweetalert2';
import axios from 'axios';
import API_BASE_URL from '../../config'; // Certifique-se de ajustar o caminho conforme necessário

export default function Ajudas() {
    const [ajudasData, setAjudasData] = useState([]);

    useEffect(() => {
        const fetchAjudasPendentes = async () => {
            try {
                const response = await axios.get(`${API_BASE_URL}ajudascusto/pendentes`);
                setAjudasData(response.data);
            } catch (error) {
                console.error('Erro ao buscar ajudas de custo:', error);
            }
        };

        fetchAjudasPendentes();
    }, []);

    const atualizarEstadoCustos = async (idCusto, novoEstado, confirmacao) => {
        const result = await Swal.fire({
            title: confirmacao ? 'Tem a certeza?' : 'Confirmação!',
            text: confirmacao ? 'Esta ação será confirmada.' : 'Deseja realmente atualizar o estado?',
            icon: 'warning',
            showCancelButton: true,
            confirmButtonColor: '#3085d6',
            cancelButtonColor: '#d33',
            confirmButtonText: confirmacao ? 'Sim, confirmar!' : 'Sim',
            cancelButtonText: 'Cancelar'
        });

        if (result.isConfirmed) {
            try {
                const response = await axios.put(`${API_BASE_URL}ajudascusto/estado/${idCusto}`, { id_estado: novoEstado });
                console.log('Estado atualizado com sucesso:', response.data);
                setAjudasData(ajudasData.filter(ajuda => ajuda.id_custo !== idCusto));
                Swal.fire('Sucesso!', 'O pedido foi atualizado.', 'success');
            } catch (error) {
                console.error('Erro ao atualizar estado:', error);
                Swal.fire('Erro!', 'Não foi possível atualizar o pedido.', 'error');
            }
        }
    };

    return (
        <div className="container mt-5">
            <h2 className="mb-4">Ajudas de Custo Pendentes</h2>
            <div className="table-responsive">
                <table className="table align-middle">
                    <thead className="table-light">
                        <tr>
                            <th scope="col"></th>
                            <th scope="col">Colaborador</th>
                            <th scope="col">Custo</th>
                            <th scope="col">Descrição</th>
                            <th scope="col">Comprovativo</th>
                            <th scope="col">Ações</th>
                        </tr>
                    </thead>
                    <tbody>
                        {ajudasData.map((ajuda) => (
                            <tr key={ajuda.id_custo}>
                                <td>
                                    <img src={ajuda.utilizador?.foto || 'https://via.placeholder.com/50'} alt="User" className="rounded-circle" width="40" height="40" />
                                </td>
                                <td>{ajuda.utilizador?.nome || 'N/A'}</td>
                                <td>{ajuda.custo}</td>
                                <td>{ajuda.descricao}</td>
                                <td>
                                    <a href={`/path/to/comprovativos/${ajuda.comprovativo}`} download className="text-decoration-none">
                                        <FaFilePdf className="me-2" /> {ajuda.comprovativo}
                                    </a>
                                </td>
                                <td>
                                    <button
                                        className="btn p-1"
                                        style={{ color: 'green' }}
                                        onClick={() => atualizarEstadoCustos(ajuda.id_custo, 1, true)} // 1 = Aceite
                                    >
                                        <FaCheck size={20} />
                                    </button>
                                    <button
                                        className="btn p-1"
                                        style={{ color: 'red' }}
                                        onClick={() => atualizarEstadoCustos(ajuda.id_custo, 2, false)} // 2 = Recusado
                                    >
                                        <FaTimes size={20} />
                                    </button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}
